import {combineReducers} from 'redux';

function inititateState (state = {authenticateState: ''}, action) {
    // console.log('reducer',action);
    if(action.type === 'authenticate'){
        return {
            authenticateState : action.payload,
            name        : action.name,
            email       : action.email,
            image       : action.image,
            type        : action.Type,
            userId      : action.userId,
            mobile      : action.mobile,
            storeName   : action.storeName,
            storeEmail  : action.storeEmail,
            storeMobile : action.storeMobile,
            streetName  : action.streetName,
            location    : action.location,
            city        : action.city,
            zipCode     : action.zipCode,
        }
    }
    return state;
}

function jobReducer(state = {job:""},action){
    if(action.type === 'job'){
        return {
            jobId : action.jobId,
            vendor: action.venddor,
        }
    }
    return state;
}

export default combineReducers ({
    inititateState,
    jobReducer,
})
